#define ABB_TX_IDLE_ANA_1_1_tx_i_pd_a_idle_1_END      (3)
#define ABB_TX_IDLE_ANA_1_1_tx_div_mode_idle_1_START  (4)
#define ABB_TX_IDLE_ANA_1_1_tx_div_mode_idle_1_END    (5)
