/*****************************************************************************
 结构名    : ABB_TX_IDLE_ANA_2_1_UNION
 结构说明  : TX_IDLE_ANA_2_1 寄存器结构定义。地址偏移量:0x55C，初值:0x3A，宽度:8
 寄存器说明: TX IDLE配置寄存器，经过线控逻辑后送至reg_analog_wr49。
*****************************************************************************/
typedef union
{
    unsigned long      uwValue;
    struct
    {
        unsigned long  current_mode_op1_idle_1 : 2;  /* bit[0-1]: LPF OP1 电流模式调整
                                                                  00/01/11 输出级电流正常，miller补偿电容正常
                                                                  10 输出级电流增加到1.25倍，miller补偿电容变大（适用于3uA偏置） */
        unsigned long  current_mode_op2_idle_1 : 2;  /* bit[2-3]: LPF OP2 电流模式调整
                                                                  00 输出级电流增加到1.5倍，miller补偿电容变大（适用于5uA偏置）
                                                                  01 输出级电流正常，miller补偿电容正常（适用于10uA偏置）
                                                                  10 输出级电流增加到2.25倍，miller补偿电容变大（适用于3uA偏置）
                                                                  11 输出级电流增加到1.5倍，miller补偿电容变大（适用于5uA偏置） */
        unsigned long  lpf_mode_idle_1         : 2;  /* bit[4-5]: LPF 运放偏置电流调整
                                                                  运放电流：   op1   op2
                                                                  00：         10u   10u 
                                                                  01：         5u    5u
                                                                  10：         8u    8u
                                                                  11：         3u    3u（默认）  */
        unsigned long  reserved                : 1;  /* bit[6]  : reserved */
        unsigned long  tx_mode_clk_idle_b3_1   : 1;  /* bit[7]  : {TX_XX_ANA_2[7],TX_XX_ANA_1[1:0]}组成联合的模式控制,参见tx_mode_clk_idle说明。 */
        unsigned long  reserved_butt           : 24; /* bit[8-31] */
    } reg;
} ABB_TX_IDLE_ANA_2_1_UNION;
#define ABB_TX_IDLE_ANA_2_1_current_mode_op1_idle_1_START  (0)
#define ABB_TX_IDLE_ANA_2_1_current_mode_op1_idle_1_END    (1)
#define ABB_TX_IDLE_ANA_2_1_current_mode_op2_idle_1_START  (2)
#define ABB_TX_IDLE_ANA_2_1_current_mode_op2_idle_1_END    (3)
#define ABB_TX_IDLE_ANA_2_1_lpf_mode_idle_1_START          (4)
#define ABB_TX_IDLE_ANA_2_1_lpf_mode_idle_1_END            (5)
#define ABB_TX_IDLE_ANA_2_1_tx_mode_clk_idle_b3_1_START    (7)
#define ABB_TX_IDLE_ANA_2_1_tx_mode_clk_idle_b3_1_END      (7)


